import React from "react";
import './popup.css'

const Popup = (props) => {
const {id, thumbnailUrl, title} = props
    return(
            <li key={thumbnailUrl} className="collection-item avatar">
                <img src={thumbnailUrl} alt="" class="circle"></img>
                <p className="black-text">{title}</p>
                <p className="black-text">{id}</p>
            </li>
    )
}

export default Popup;
